import './App.css';

function App() {

  async function data() {
    try {
      const dados = await fetch('https://jsonplaceholder.typicode.com/todos/1')
        .then(response => response.json())
        .then(json => console.log(json))
        return dados
    } catch(e) {
      console.log(e)
    }
  }


  return (
    <div className="App">
     {data()}
    </div>
  );
}

export default App;
